import React from "react";
import Logo from "../Logo_nav/Logo";
import search from '../../assets/search.svg';
import profile from '../../assets/profile.svg';
import bag from '../../assets/bag.svg';


const Navbar: React.FC = () => {
    return (
        <div id="all-navbar">
            <div className="left-nav navbar">
                <button><img src={logo} alt="logo" /></button>
                {/* <button id="epicure-button">ECIPURE</button> */}
                <Navbar />;
                <button id="chefs-button">Chefs</button>
            </div>
            <div className="right-nav navbar">
                <div id="button-search">
                    <input type="text"/>
                    {/* <img src="icon.png"/> */}
                    <button><img src={search} alt="search" /></button>
                </div>
                <button><img src={profile} alt="profile" /></button>
                <button><img src={bag} alt="bag" /></button>
            </div>
        </div>
    )
}

export default Navbar
